import styled, { keyframes } from 'styled-components';


export const moveUp = keyframes`
  from {
    margin-top: 200px;
  }

  to {
    margin-top: 50px;
  }
`;

export const Center = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  font-size: 18px;
`;

export const Img = styled.img`
  border-radius: 8px;
  max-width: 100%;
  height: auto;
  margin-left: auto;
  margin-right: auto;
  display: block;
  width: 100%;
`;


export const BigText = styled.p`
  text-align: center;
  font-size: 48px;
  animation: ${moveUp} 1s;
`;

export const Home = styled.div`
  margin-top: 50px;
  position: relative;
`;
